const Title = () => {
  return (
    <div className="w-1/4 h-full flex items-center justify-center pt-2">
      <div className="w-1/3 h-full font-MaplestoryBold font-extrabold text-6xl text-[#FC5230] text-stroke text-stroke-mainWhite">
        우
      </div>
      <div className="w-1/3 h-full font-MaplestoryBold text-6xl text-[#FFD600] text-stroke text-stroke-mainWhite">
        아
      </div>
      <div className="w-1/3 h-full font-MaplestoryBold text-6xl text-[#18A8F1] text-stroke text-stroke-mainWhite">
        한
      </div>
    </div>
  );
};

export default Title;
